import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

const Result = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const resultData = location.state?.resultData;

  // Handle the case where resultData is undefined
  if (!resultData) {
    return (
      <div>
        <h2>No results to display</h2>
        <button onClick={() => navigate('/')}>Go Back</button>
      </div>
    );
  }

  return (
    <div>
      <h2>Loan Application Result</h2>
      <p>Eligibility: {resultData.Eligibility ? 'Eligible' : 'Not Eligible'}</p>
      <p>Requested Loan Amount: {resultData.Requested_Loan_Amount}</p>
      <p>Preferred Repayment Period: {resultData.Preferred_Repayment_Period} months</p>
      <p>EMI: {resultData.EMI}</p>
      <p>Risk Score: {resultData.Risk_Score}</p>
    </div>
  );
};

export default Result;
